import React from "react";
import { Link } from "react-router-dom";
import { Header } from "../shared/Header";
import { Markdown } from "../shared/Markdown";
import { Scroll } from "../shared/Scroll";

const VERSION = "3.2.1";
const BODY = `
Antropoloops Player es una herramienta
desarrollada dentro del contexto de los
[Talleres Antropolops](https://talleres.antropollops.com)

Ha sido financiado por la fundación Carasso (¡¡gracias!!)
![/carasso.jpg](https://www.fondationcarasso.org/es/)

Tanto el [código](https://github.com/antropoloops/player)
 como los contenidos están publicados con licencias libres.


`;

export const About = () => {
  return (
    <div className="App NotFound">
      <Header />
      <Scroll>
        <div className="content">
          <div className="inside">
            <h3>Antropoloops Player</h3>
            <div>Versión {VERSION}</div>
            <Markdown markdown={BODY} />
            <Link to="/">Volver al inicio</Link>
          </div>
        </div>
      </Scroll>
    </div>
  );
};
